4e\u0431\u043e\u0432\u044c''. \u0414\u0435\u043b\u0430\u0435\u0448\u044c \u0448\u0430\u0433 \u043d\u0430\u0437\u0430\u0434.\n\u041f\u043b\u0430\u0432\u0438\u0442\u0441\u044f\n\u043f\u0430\u0440\n\u043a\u0435\u0442.\n\n\u0428\u0435\u043f\u0447\u0435\u0448\u044c:\n''\u043d\u0430\u0441 \u0436\u0434\u0435\u0442 \u0410\u0434''.\n\u042f \u0433\u043e\u0432\u043e\u0440\u044e: ''\u0441\u0432\u0435\u0442 -\n\u044d\u0442\u043e \u0431\u043e\u043b\u044c\u0448\u043e\u0439 \u043e\u0431\u043c\u0430\u043d.\n\u0421\u0432\u0435\u0442\u0430 \u0438 \u0422\u044c\u043c\u044b \u043d\u0435\u0442.\n\u0421\u0432\u0435\u0442 - \u044d\u0442\u043e \u0442\u044b\n\u0441\u0430\u043c''. (\u0442\u044b - \u044d\u0442\u043e \u043c\u043e\u0439 \u0441\u0432\u0435\u0442). \u0422\u044b - \u0432\u0430\u0441\u0438\u043b\u0438\u0441\u043a, \u0438\n\u044f \u0437\u0430\u043a\u0440\u044b\u0432\u0430\u044e \u0442\u0432\u043e\u0438 \u0433\u043b\u0430\u0437\u0430.\n\u0413\u043e\u0440\u0435\u043a \u0438 \u0441\u043b\u0430\u0434\u043e\u043a \u0440\u0438\u0441\u043a,\n\u0441\u043e\u0440\u0432\u0430\u043d\u044b \u0442\u043e\u0440\u043c\u043e\u0437\u0430.\n\n\u042d\u0442\u043e \u0442\u0432\u043e\u0439 \u043f\u0435\u0440\u0432\u044b\u0439 \u0434\u0436\u0430\u0437.\n\u042d\u0442\u043e \u043c\u043e\u0439 \u043f\u0435\u0440\u0432\u044b\u0439 \u0431\u043b\u044e\u0437.\n\u042d\u0442\u043e \u043c\u043e\u0439 \u043f\u0435\u0440\u0432\u044b\u0439 \u0440\u0430\u0437.\n\u041a\u043e\u0433\u0434\u0430\n\u044f\n\u043b\u044e\n\u0431\n\u043b\u044e. \n#\u041c\u043e\u0441\u043a\u0432\u0430 #\u043a\u0440\u0430\u0441\u043e\u0442\u0430 #\u0432\u0435\u0441\u043d\u0430 #\u0433\u0443\u043b\u044f\u0435\u043c #\u043a\u0430\u0439\u0444 #\u043b\u044e\u0431\u043b\u044e #Moscow #beautiful #spring #vsco #vscocam #love #hot #happy #smile #cute #run #cool #nice #good #night #liketime #like4likes #likeforlikes #fashion #look #likeforfollow #morning #sky"}}]},"shortcode":"B9w9LvSnOYK","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584298168,"d th":480,"config_height":480},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89919202_2958805834143952_303229721026689101_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=104\u0026_nc_ohc=387iX9KyymQAX94vCvr\u0026oh=7bfb1e93f808ad9631844f5ff2a5a137\u0026oe=5E9F6688","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":"\u6ca1\u6709\u7167\u7247\u63cf\u8ff0\u3002"}},{"node":{"comments_disabled":false,"__typename":"GraphImage","id":"2265576694994176830","edge_media_to_caption":{"edges":[{"node":{"text":"Ganz trauriger Nachmittag f\u00fcr mich \ud83d\ude2d\ud83d\udc94 eine Kindergarten Fotoshooting m\u00fcssten wir absagen und gerade habe ich diesen E-Mail wegen unsere Fr\u00fchling Aktion an 58 Kunden geschickt \ud83d\ude2d\ud83d\ude2d\ud83d\ude2d\ud83d\ude2d\ud83d\ude2d f\u00fcr uns kleineren Firmen wird es eine sehr schwierige Zeit. das ist aber nicht nur finanziell sondern auch emotional f\u00fcr mich eine sehr schwere Zeit. das ist das erste Mal in 11Jahren dass ich Termine absagen muss. ich war immer sehr stolz darauf, egal was es komme, ich werde eure Termine nie Absagen. aber mit so viele Leute hintereinander w\u00e4re das Ansteckung Gefahr hier zu gro\u00df und das w\u00e4re unverantwortlich. \ud83d\ude2d\ud83d\ude2d\ud83d\ude2d\ud83d\ude2d\ud83d\ude2d\ud83d\ude2d\ud83d\ude2d\ud83d\ude2d\ud83d\ude2d\ud83d\ude2d\ud83d\ude2d\" Wie ihr bestimmt wei\u00dft, viele Veranstaltungen sind wegen coronavirus in NRW abgesagt wurden. Und es wird von allen Medien und Experten empfohlen alle nicht lebensnotwendige Kontakte zu vermeiden. Aus diesem Grund, zur Sicherheit Eure und meine Familie muss ich hiermit leider meine Ostern Fr\u00fchling Mini Aktion schweren Herzen absagen bzw. verschieben. F\u00fcr die Mini Aktion von 23.03 bis 05.04 haben sich sehr viele Familien Termine reserviert, da jede halbe Stunde neue Familien hier zum Studio kommen, habe ich keine M\u00f6glichkeit mein Studio so gr\u00fcndlich wie aktuell notwendig vor dem n\u00e4chste Kunde zu desinfizieren. Es gibt einfach mit der gro\u00dfe Anzahl an Leute auch eine gro\u00dfe Ansteckungsgefahr. Ich hoffe ihr seid mir nicht b\u00f6se. Die Entscheidung f\u00e4llt mir nicht nur aus finanziellen Gr\u00fcnden sehr sehr schwer, sondern vor allem auch emotional. \nIch verspreche, dass wir die Aktion nachholen werden. Diejenigen die sich bei mir in Kalender eingetragen haben, bekommen auf jeden Fall die Chance noch mal eine neue Termin zu reservieren, nat\u00fcrlich mit gleichen g\u00fcnstigen Aktionspreise. Ich habe nat\u00fcrlich sehr viele sch\u00f6ne dekos f\u00fcr die Aktion bestellt, die ich auch gerne noch benutzen will, sobald das die ganze Drama mit Coronavirus sich beruhigt hat, werde ich mich mit neuer Datum melden und wie gesagt versprochen diejenigen die schon Termine gebucht haben bekommen hundertprozentig neue Termine mit dieselbe Preis wieder.\n\nLG\neure Niuosha \""}}]},"shortcode":"B9w8gAkiAs-","edge_media_to_comment":{"count":1},"taken_at_timestamp":1584297809,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89678363_2128512483961699_6934082718851830047_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=107\u0026_nc_ohc=nfHppfKhEcsAX-UMGLa\u0026oh=da3922f6eb608b8d6230be9df9b4a802\u0026oe=5E9C57E7","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"277566147"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/89678363_2128512483961699_6934082718851830047_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=107\u0026_nc_ohc=nfHppfKhEcsAX-UMGLa\u0026oh=4bbd8216dcbfea424e6648ef7ff2e364\u0026oe=5E9B3A5D","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/89678363_2128512483961699_6934082718851830047_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=107\u0026_nc_ohc=nfHppfKhEcsAX-UMGLa\u0026oh=5523521
